import React, { Component } from 'react';
import TOC from './components/TOC.js'
import './App.css';

class Subject1 extends Component { //props 예제
  render() { //컴퍼넌트는 반드시 하나의 최상위 태그로 시작해야함 
    return (
      <header>
        <h1>{this.props.title}</h1>
        {this.props.sub}
    </header>
    );
  }
}
class Subject2  extends Component { //state 예제
  render() { 
    return (
      <header>
        <h1>{this.props.title}</h1>
        {this.props.sub}
    </header>
    );
  }
}
class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      subject2:{title:"WEB", sub:"welcome!"}
    }
  }
  render() {
    return (
      <div className="App">
        <Subject1 title="WEB" sub="welcome!"></Subject1>
        <Subject2>
          title = {this.state.subject2.title}
          sub = {this.state.subject2.sub}
        </Subject2>
        <TOC></TOC>
      </div>
    );
  }
}
class HTML extends Component {

}
export default App;
